def factorial(n):
    if n < 0:
        return 0
    if n == 0 or n == 1:
        return 1
    if n % 2 == 0:
        return 2 * factorial(n // 2)
    else:
        return n * factorial(n // 2)

def binomial_coefficient(n, k):
    if k < 0 or k > n:
        return 0
    if k == 0 or k == n:
        return 1
    if k % 2 == 0:
        return binomial_coefficient(n - 1, k // 2) * factorial(k)
    else:
        return binomial_coefficient(n - 1, (k - 1) // 2) * factorial(k)

