    return [a, b, c]

def find_middle_term(abc):
    for a in range(abc[0], abc[2] + 1):
        for b in range(abc[1], abc[2] + 1):
            if is_arithmetic_sequence(a, b, abc[2]):
                return get_middle_term(a, b, abc[2])
    return None

def main():
    abc = [3, 5, 6, 7, 9]
    if is_arithmetic_sequence(abc[0], abc[1], abc[2]):
        print(get_middle_term(abc[0], abc[1], abc[2]))
    else:
        print(find_middle_term(abc))

